import React from 'react';
import { useNavigate } from 'react-router-dom';
import headbg from './Images/header_bg.jpg';
import wesafelogo from './Images/wesafe_Logo.png';
import userprofile from './Images/avatar.png';
import toggle from './Images/toggle_menu.png';

const Dashboard = ({ onToggleSidebar }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Implement your logout logic here
    navigate('/');
  };

  return (
    <div 
      className="relative w-full h-24 bg-cover bg-no-repeat bg-center flex items-center"
      style={{ backgroundImage: `url(${headbg})` }}
    >
      {/* Sidebar Toggle */}
      <button onClick={onToggleSidebar} className="absolute left-4 top-1/2 transform -translate-y-1/2 focus:outline-none">
        <img src={toggle} alt="Toggle Menu" className="h-6 w-6" />
      </button>

      {/* Centered Logo */}
      <div className="flex justify-center w-full">
        <img src={wesafelogo} alt="Company Logo" className="h-12" />
      </div>

      {/* Right-side elements */}
      <div className="absolute right-4 top-1/2 transform -translate-y-1/2 flex items-center">
        <img src={userprofile} alt="User Profile" className="h-10 w-10 rounded-full mr-2" />
        <button onClick={handleLogout} className="bg-transparent hover:bg-gray-700 text-white p-2 rounded border border-white hover:border-gray-700">
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
